DescricaoVaga:
Prestar mentoria, coaching e treinamentos em metodos ageis para times ageis, Scrum Masters e Product Owners;
 Orientar e ajudar o time a solucionar problemas do negocio atraves da construcao de software;
Atuar como Scrum Master em projetos que tenham necessidade eminente de apoio para esta função. 
Experiência sólida em Scrum, Kanban, XP e outras metodologias e práticas ágeis;
Saber lidar com a Gestão da Mudança e Resolução de Conflitos.
